import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './pages/Home';
import AdminPage from './pages/AdminPage';
import Timesheetsp from './pages/Timesheetsp';
import EmployeeListp from './pages/EmployeeListp';
import SearchPage from './pages/SearchPage';
import UploadPage from './pages/UploadPage';
import PlacementPage from './pages/PlacementPage';
import ProjectsPage from './pages/ProjectsPage';
// import Aboutusp from './pages/Aboutusp';
import Orgstructurep from './pages/Orgstructurep';
import ExpensesPage from './pages/ExpensesPage';
import Loginpage from './pages/Loginpage';
import PrivateRoute from './utils/PrivateRoute';
import { AuthProvider } from './context/AuthContext';


function App() {
  return (
    <Router>
      <div className='App'>
        <AuthProvider>
          <Routes>
            <Route element={<PrivateRoute/>} >
              <Route path="/"  exact  element={<Home/>} />
              <Route path="/home" element={<Home/>} />
              <Route path="/admin" element={<AdminPage/>} />
              <Route path="/timesheets" element={<Timesheetsp/>} />
              <Route path="/placements" element={<PlacementPage/>} />
              <Route path="/projects" element={<ProjectsPage/>} />
              <Route path="/expenses" element={<ExpensesPage/>} />
              <Route path="/list" element={<EmployeeListp/>} />
              <Route path="/search" element={<SearchPage/>} />
              <Route path="/upload" element={<UploadPage/>} />
              {/* <Route path="/aboutus" element={<Aboutusp/>} /> */}
              <Route path="/organisation" element={<Orgstructurep/>} />
            </Route>

            <Route path="/login" element={<Loginpage />} />

          </Routes>
        </AuthProvider>
      </div>
    </Router>
  );
}

export default App;
